soup = BeautifulSoup(html, "html.parser")

incidents = []
for row in soup.find_all("tr", class_="k-alt"):
    incident = {}
    incident["description"] = row.find_all("td", role="gridcell")[1].get_text().strip()
    incident["incident_number"] = (
        row.find_all("td", role="gridcell")[2].get_text().strip()
    )
    incident["location"] = row.find_all("td", role="gridcell")[3].get_text().strip()
    incident["agency"] = row.find_all("td", role="gridcell")[4].get_text().strip()
    incident["date"] = row.find_all("td", role="gridcell")[5].get_text().strip()
    incidents.append(incident)

for incident in incidents:
    print("Description:", incident["description"])
    print("Incident Number:", incident["incident_number"])
    print("Location:", incident["location"])
    print("Agency:", incident["agency"])
    print("Date:", incident["date"])
    print("---")

    table = soup.find("table")
with open("LAdata.csv", "w", newline="") as csvfile:
    writer = csv.writer(csvfile)
    writer.writerow(["Column1", "Column2", "Column3"])
    for row in table.find_all("tr"):
        cells = row.find_all("td")
        data = [cell.text for cell in cells]
        writer.writerow(data)
print("Data has been exported to data.csv")
